import React from 'react';
import './App.css';
import Main from './components/Pages/Main';
import Navbar from './components/Navbar/Navbar';
import Particles from 'react-particles-js';

const App = () => (
  <div>
    <Particles />
    <Navbar />
    <div className="container">
      <Main />
    </div>
  </div>
)

export default App;
